import React from 'react';
import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAlignCenter, faCoffee, faDisplay, faFaceMehBlank, faImage, faPerson } from '@fortawesome/free-solid-svg-icons';
import logo from '../../logo.svg';
import './Home.css';

function Home() {
  const [selectedOption1, setSelectedOption1] = useState('');
  const [selectedOption2, setSelectedOption2] = useState('');

  const dynamicOptions1 = [
    { value: 'option1a', label: 'Option 1A' },
    { value: 'option1b', label: 'Option 1B' },
    { value: 'option1c', label: 'Option 1C' },
  ];
  
  const handleOption1Change = (event) => {
    setSelectedOption1(event.target.value);
  };

  const handleOption2Change = (event) => {
    setSelectedOption2(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Perform actions with selected options, e.g., submit to a server
    console.log('Selected Option 1:', selectedOption1);
    console.log('Selected Option 2:', selectedOption2);
  };
  return (
    <>
      <header className='header'>
          <div className='header-logo'>
            <h2>Project Vault</h2>
          </div>
          <div className='header-nav-elements'>
            <a href="#">
              <div>Home</div>
            </a>
            <a href="#">
              <div>About</div>
            </a>
            <a href="#">
              <div>Contact</div>
            </a>
            <a href="#">
              <div>
                <FontAwesomeIcon icon={faFaceMehBlank} className='icon' />
              </div>
            </a>
          </div>
      </header>
      <body className='body'>
        <h1>Welcome to ProjectVault</h1>
        <p>Explore the perfect projects for your acedamic requirements, with all source codes, reports, included</p>
        <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="dropdown1">Dropdown 1:</label>
          <select id="dropdown1" value={selectedOption1} onChange={handleOption1Change}>
            <option value="">Select Option 1</option>
            {dynamicOptions1.map((option) => (
              <option key={option.value} value={option.value}>
                {option.label}
              </option>
            ))}
          </select>
        </div>

        <div>
          <label htmlFor="dropdown2">Dropdown 2:</label>
          <select id="dropdown2" value={selectedOption2} onChange={handleOption2Change}>
            <option value="">Select Option 2</option>
            <option value="option2a">Option 2A</option>
            <option value="option2b">Option 2B</option>
            <option value="option2c">Option 2C</option>
          </select>
        </div>

        <button type="submit">Submit</button>
      </form>
      </body>
      <h1> . </h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
      <h1>Hello, you're Home</h1>
    </>
  );
}

export default Home;
